import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useSelector } from 'react-redux';

const Dashboard = () => {
  const navigate = useNavigate();
  const firstName = useSelector((state) => state.auth.first_name);
  const [apps, setApps] = useState([]);
  const [newAppName, setNewAppName] = useState('');
  const [newAppPoints, setNewAppPoints] = useState('');
  const [newAppImage, setNewAppImage] = useState(null);

  const handleAppAdd = (e) => {
    e.preventDefault();
    // Implement app add functionality
  };

  const handleAppUpdate = (appId) => {
    // Implement app update functionality
  };

  const handleLogout = () => {
    localStorage.clear();
    navigate('/login');
  };

  return (
    <div className="min-h-screen bg-gray-900">
      <nav className="bg-black p-4 shadow-lg border-b border-gray-800">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-gray-200 font-bold text-2xl">
            Leave Management Portal (Manager)
          </h1>
          <div className="flex items-center space-x-4 ml-auto">
            <h1 className="text-gray-300 text-lg">Welcome, {firstName}</h1>
            <button
              className="bg-gray-800 px-4 py-2 rounded text-gray-200 hover:bg-gray-700 transition duration-300"
              onClick={handleLogout}
            >
              Logout
            </button>
          </div>
        </div>
      </nav>

      <div className="container mx-auto flex flex-row mt-6 justify-between px-6 gap-6">
        <div>
          <h2 className="text-xl font-bold mb-2">Add New App</h2>
          <form onSubmit={handleAppAdd} className="space-y-4">
            <div>
              <label htmlFor="name" className="block font-medium">
                Name
              </label>
              <input
                type="text"
                id="name"
                value={newAppName}
                onChange={(e) => setNewAppName(e.target.value)}
                className="border rounded px-3 py-2 w-full"
              />
            </div>
            <div>
              <label htmlFor="points" className="block font-medium">
                Points
              </label>
              <input
                type="number"
                id="points"
                value={newAppPoints}
                onChange={(e) => setNewAppPoints(e.target.value)}
                className="border rounded px-3 py-2 w-full"
              />
            </div>
            <div>
              <label htmlFor="image" className="block font-medium">
                Image
              </label>
              <input
                type="file"
                id="image"
                onChange={(e) => setNewAppImage(e.target.files[0])}
                className="border rounded px-3 py-2 w-full"
              />
            </div>
            <button
              type="submit"
              className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded"
            >
              Add App
            </button>
          </form>
        </div>
        <div>
          <h2 className="text-xl font-bold mb-2">Existing Apps</h2>
          <table className="w-full">
            <thead>
              <tr>
                <th className="px-4 py-2">Name</th>
                <th className="px-4 py-2">Points</th>
                <th className="px-4 py-2">Actions</th>
              </tr>
            </thead>
            <tbody>
              {apps.map((app) => (
                <tr key={app.id}>
                  <td className="border px-4 py-2">{app.name}</td>
                  <td className="border px-4 py-2">{app.points}</td>
                  <td className="border px-4 py-2">
                    <button
                      onClick={() => handleAppUpdate(app.id)}
                      className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mr-2"
                    >
                      Edit
                    </button>
                    {/* Add delete functionality here */}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
